import React from "react";
import Header from "../components/Header/Header";
import BodyLayout from "../components/Body/BodyLayout";
import Footer from "../components/Footer/Footer";
import styled from "styled-components";

const ProfileSummary = styled.section`
  width: 60vw;
  height: 32vh;
  margin-top: calc(var(--margin-default) * 3);
  background-color: var(--concept-color6);
  display: flex;
`;

const UserFace = styled.div`
  width: 28%;
  display: flex;
  flex-direction: column;
  align-items: center;
`;

const UserIcon = styled.div`
  margin: calc(var(--margin-default) / 4) 0 0 var(--margin-default);
  width: 24vh;
  height: 24vh;
`;

const IconContainer = styled.div`
  width: 100%;
  height: 100%;
  border-radius: 50%;
  overflow: hidden;
  img {
    width: 100%;
    height: 100%;
  }
`;

const UserName = styled.div``;

const MemberHome = () => {
  return (
    <div>
      <Header />
      <BodyLayout>
        <ProfileSummary>
          <UserFace>
            <UserIcon>
              <IconContainer>
                <img src="images/user.jpg" />
              </IconContainer>
            </UserIcon>
            <UserName>김승규 님</UserName>
          </UserFace>
        </ProfileSummary>
      </BodyLayout>
      <Footer />
    </div>
  );
};

export default MemberHome;
